import { Route, Routes } from "react-router-dom";

const Welcome = () => {
    return (
      <section>
        <h1> The Welcome Page </h1>
        <Routes>
          <Route path="/welcome/new-user" element={<p></p>}>
            <p> Welcome new user! </p>
          </Route>
        </Routes>
      </section>
    );
}

export default Welcome;
